import Link from "next/link";

const BlockLink = (props) => (
  <Link
    href={`/${props.link}?id=${props.id}`}
    as={`/${props.link}/${props.id}`}
  >
    <a>
      <div className="block-option">
        <h2>{props.title}</h2>
      </div>
    </a>
  </Link>
);

const MenuBlock = ({ title, link, id }) => {
  return <BlockLink title={title} link={link} id={id} />;
};

export default MenuBlock;
